// FindAllCache 查询所有数据并设置缓存
func (p *PartitionTableRepo) FindAllCache(ctx context.Context) ([]*gorm_gen_model.PartitionTable, error) {
	resp := make([]*gorm_gen_model.PartitionTable, 0)
	cacheKey := p.cache.Key(CachePartitionTableAll)
	cacheValue, err := p.cache.Fetch(ctx, cacheKey, func() (string, error) {
		dao := gorm_gen_dao.Use(p.db).PartitionTable
		result, err := dao.WithContext(ctx).Find()
		if err != nil {
			return "", err
		}
		marshal, err := p.encoding.Marshal(result)
		if err != nil {
			return "", err
		}
		return string(marshal), nil
	})
	if err != nil {
		return nil, err
	}
	if cacheValue != "" {
		err = p.encoding.Unmarshal([]byte(cacheValue), resp)
		if err != nil {
			return nil, err
		}
	}
	return resp, nil
}

